INSERT INTO public.posts VALUES ('POST000987', 'u   967', 'P00187', 'Lần đầu thử trải nghiệm tại Chùa Trấn Quốc. Giá Cả Hợp Lý, wifi yếu. Phù hợp đi cùng gia đình.');
INSERT INTO public.posts VALUES ('POST000988', 'u   968', 'P00188', 'Cuối tuần mình tới Bún chả Hương Liên. Giá Cả Hợp Lý, khó tìm chỗ ngồi. Ổn trong tầm giá.');
INSERT INTO public.posts VALUES ('POST000989', 'u   969', 'P00189', 'Cuối tuần mình tới Bảo tàng Mỹ thuật Việt Nam. Rất Sạch Sẽ, điểm trừ nhỏ về vệ sinh. Hợp để hẹn hò.');
INSERT INTO public.posts VALUES ('POST000990', 'u   970', 'P00190', 'Mình vừa ghé Sofitel Legend Metropole Hanoi. View Khá Ấn Tượng, giá hơi cao. Phù hợp đi cùng gia đình.');
INSERT INTO public.posts VALUES ('POST000991', 'u   971', 'P00191', 'Lần đầu thử trải nghiệm tại Lotte Hotel Hanoi. Dịch Vụ Nhanh Chóng, chỗ gửi xe bất tiện. Tổng thể đáng thử.');
INSERT INTO public.posts VALUES ('POST000992', 'u   972', 'P00192', 'Đã có dịp đến Hồ Tây. View Khá Ấn Tượng, chỗ gửi xe bất tiện. Phù hợp đi cùng gia đình.');
INSERT INTO public.posts VALUES ('POST000993', 'u   973', 'P00193', 'Trải nghiệm của mình tại Pan Pacific Hanoi. Rất Sạch Sẽ, khá đông và ồn. Ổn trong tầm giá.');
INSERT INTO public.posts VALUES ('POST000994', 'u   974', 'P00194', 'Lần đầu thử trải nghiệm tại Hồ Hoàn Kiếm (Hồ Gươm). Vị Trí Thuận Tiện, điểm trừ nhỏ về vệ sinh. Sẽ quay lại lần nữa.');
INSERT INTO public.posts VALUES ('POST000995', 'u   975', 'P00195', 'Cuối tuần mình tới JW Marriott Hotel Hanoi. Vị Trí Thuận Tiện, giá hơi cao. Tổng thể đáng thử.');
INSERT INTO public.posts VALUES ('POST000996', 'u   976', 'P00196', 'Chuyến đi ngắn tới Bún chả Hương Liên. View Khá Ấn Tượng, khó tìm chỗ ngồi. Khuyến nghị nên đặt trước.');
INSERT INTO public.posts VALUES ('POST000997', 'u   977', 'P00197', 'Một ngày đẹp trời ở Pan Pacific Hanoi. Dịch Vụ Nhanh Chóng, phục vụ chưa đều tay. Khuyến nghị nên đặt trước.');
INSERT INTO public.posts VALUES ('POST000998', 'u   978', 'P00198', 'Chuyến đi ngắn tới Lotte Hotel Hanoi. Rất Sạch Sẽ, wifi yếu. Khuyến nghị nên đặt trước.');
INSERT INTO public.posts VALUES ('POST000999', 'u   979', 'P00199', 'Đã có dịp đến Phở Gia Truyền Bát Đàn. Nhân Viên Thân Thiện, phục vụ chưa đều tay. Khuyến nghị nên đặt trước.');
INSERT INTO public.posts VALUES ('POST001000', 'u   980', 'P00200', 'Chuyến đi ngắn tới Xôi Yến Nguyễn Hữu Huân. Giá Cả Hợp Lý, chỗ gửi xe bất tiện. Phù hợp đi cùng gia đình.');
